import styled from 'styled-components'

const StyledCard = styled.div`
  height: 150px;
  width: 150px;

  border: solid 3px #4b4b4b;
  border-radius: 5px;
  display: flex;
  flex-direction: column;

  a {
    width: 100px;
    height: 100px;
    background-size: cover;
  }
`;


function ProjectCard({ title, date, image, excerpt, url }) {
  return (
    <StyledCard>
      <a 
        href={url}>
      </a>
      <h2>{title}</h2>
    </StyledCard>
  );
}

export default ProjectCard;
